// src/components/Facturar.jsx
import React, { useState } from "react";
import {
  verificarAntecedentes,
  getInventario,
  facturarCliente,
} from "../services/api";


const Facturar = () => {
  const [cedula, setCedula] = useState("");
  const [respuesta, setRespuesta] = useState(null);
  const [error, setError] = useState("");
  const [inventario, setInventario] = useState([]);
  const [productosSeleccionados, setProductosSeleccionados] = useState([]);

  const token = localStorage.getItem("token");

  const handleSubmit = async (e) => {
    e.preventDefault();
    setRespuesta(null);
    setError("");
    setProductosSeleccionados([]);

    try {
      const data = await verificarAntecedentes(cedula, token);
      setRespuesta(data.estado);

      if (data.estado?.toLowerCase() === "sin antecedentes") {
        const productos = await getInventario(token);
        setInventario(productos);
      }
    } catch (err) {
      setError(err.message || "No se pudo conectar con el servicio");
    }
  };

  const handleAgregar = (producto) => {
    const existe = productosSeleccionados.find((p) => p._id === producto._id);
    if (existe) {
      setProductosSeleccionados((prev) =>
        prev.map((p) =>
          p._id === producto._id && p.cantidad < producto.cantidad
            ? { ...p, cantidad: p.cantidad + 1 }
            : p
        )
      );
    } else {
      setProductosSeleccionados((prev) => [
        ...prev,
        { ...producto, cantidad: 1 },
      ]);
    }
  };

  const handleFacturar = async () => {
    try {
      const factura = {
        cedula,
        productos: productosSeleccionados.map(({ _id, cantidad }) => ({
          id: _id,
          cantidad,
        })),
      };

      await facturarCliente(factura, token);
      alert("Factura generada con éxito");
      setProductosSeleccionados([]);
      setCedula("");
      setRespuesta(null);
    } catch (err) {
      alert("Error al generar factura: " + err.message);
    }
  };

  return (
    <div className="factura-container">
      <h2 className="factura-titulo">Nueva Factura</h2>

      <form onSubmit={handleSubmit} className="factura-form">
        <label>
          Cédula del cliente:
          <input
            type="text"
            value={cedula}
            onChange={(e) => setCedula(e.target.value)}
            required
          />
        </label>
        <button type="submit" className="factura-btn">
          Validar antecedentes
        </button>
      </form>

      {respuesta === "sin antecedentes" && (
        <>
          <h3 className="factura-subtitulo">Productos</h3>
          <div className="factura-productos-grid">
            {inventario.map((item) => (
              <div className="factura-producto-card" key={item._id}>
                <h4>{item.nombre}</h4>
                <p>{item.cantidad} disponibles</p>
                <button className="factura-btn" onClick={() => handleAgregar(item)}>
                  Agregar a la factura
                </button>
              </div>
            ))}
          </div>

          {productosSeleccionados.length > 0 && (
            <div className="factura-seleccionados">
              <h4>Productos seleccionados:</h4>
              <ul>
                {productosSeleccionados.map((p) => (
                  <li key={p._id}>
                    {p.nombre} - Cantidad: {p.cantidad}
                  </li>
                ))}
              </ul>
              <button onClick={handleFacturar} className="factura-btn-generar">
                Generar factura
              </button>
            </div>
          )}
        </>
      )}

      {respuesta && respuesta !== "sin antecedentes" && (
        <p style={{ color: "red" }}>No se puede facturar: {respuesta}</p>
      )}
      {error && <p style={{ color: "red" }}>{error}</p>}
    </div>
  );
};

export default Facturar;
